import React from 'react'
import './App.css'
import fetch from 'node-fetch'

export default class App extends React.Component {
  constructor (props) {
    super(props)
    this.state = {
    }
  }

  onClick = () => {
    fetch('http://wikipedia.simple.net/api?keyword=犬')
      .then(response => {
        return new Promise ( (resolve, reject) =>{
          return response.json
        })
      })
      .then(json => {
        console.log(json)
        })
  }

  render () {
    return (
      <div className='app'>
        <button onClick={this.onClick}>天気取得</button>
      </div>
    )
  }
}
